    public readonly RGBAColor Rotate(Scalar φ)
    {
        φ += Scalar.Tau;
        φ %= Scalar.Tau;

        if (φ.IsZero)
            return this;
        else if (φ.Is(Scalar.Pi))
            return Complement;

        (double h, double s, double l) = ToHSL();

        return FromHSL(h + φ, s, l, Af);
    }

