    [MethodImpl(MethodImplOptions.AggressiveInlining)]
    public static RGBAColor FromHCL(double H, double C, double L) => FromHCL(H, C, L, 1);

    public static RGBAColor FromHCL(double H, double C, double L, double α)
    {
        Vector3 rgb = Vector3.Zero;

        if (L != 0)
        {
            L *= HCLmaxL;

            double Q = Math.Exp((1 - C / (2 * L)) * (HCLgamma / HCLy0));
            double U = (2 * L - C) / (2 * Q - 1);
            double V = C / Q;
            double A = (H + Math.Min(((2 * H) % 1) / 4, ((-2 * H) % 1) / 8)) * Math.Tau;
            double T = Math.Tan(A);

            H *= 6;
            rgb = H switch
            {
                <= 0.999 => new(1, T / (1 + T), 0),
                <= 1.001 => new(1, 1, 0),
                <= 2 => new((1 + T) / T, 1, 0),
                <= 3 => new(0, 1, 1 + T),
                <= 3.999 => new(0, 1 / (1 + T), 1),
                <= 4.001 => new(0, 0, 1),
                <= 5 => new(-1 / T, 0, 1),
                _ => new(1, 0, -T)
            };
            rgb = rgb * V + U;
        }

        return new Vector4(rgb, α);
    }

